import React from 'react';
import Container from '@mui/material/Container';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import AppBar from '@mui/material/AppBar';

import InfoIcon from '@mui/icons-material/Info';
import ConstructionIcon from '@mui/icons-material/Construction';
import AttachMoneyIcon from '@mui/icons-material/AttachMoney';
import EmailIcon from '@mui/icons-material/Email';
import Typography from '@mui/material/Typography';


type NavbarProps = {
    transparent?: boolean;
};

export default class Navbar extends React.Component<NavbarProps> {
    public render(): JSX.Element {
        const textColor: string = 'white';

        return (
            <AppBar position="fixed" color="transparent" sx={{ paddingY: 2 }}>
                <Container>
                    <Stack direction="row" justifyContent="space-between">
                        <Typography variant="h6" color="white">
                            IWDS
                        </Typography>

                        <Stack direction="row" spacing={3} sx={{
                            display: { xs: 'none', md: 'block' },
                        }}>
                            <Button variant="text" sx={{ color: textColor }}>Free Estimate</Button>
                            <Button variant="text" sx={{ color: 'white' }}>Services</Button>
                            <Button variant="text" sx={{ color: 'white' }}>About</Button>
                            <Button variant="text" sx={{ color: 'white' }}>Contact Us</Button>
                        </Stack>
                    </Stack>
                </Container>
            </AppBar>
        );
    }
}
